import React, { useState, useEffect, useRef } from "react";
import "./App.css";

function App() {
  const [resume, setResume] = useState(null);
  const [jobDescription, setJobDescription] = useState("");
  const [matchScore, setMatchScore] = useState(null);
  const [semanticScore, setSemanticScore] = useState(null);
  const [skillMatch, setSkillMatch] = useState(null);
  const [skillSummary, setSkillSummary] = useState(null);
  const [missingSkills, setMissingSkills] = useState([]);
  const [history, setHistory] = useState([]);
  const resultRef = useRef(null);

  const analyzeResume = async () => {
    if (!resume || !jobDescription) {
      alert("Upload resume and enter job description");
      return;
    }

    const formData = new FormData();
    formData.append("resume", resume);
    formData.append("job_description", jobDescription);

    try {
      const response = await fetch("http://127.0.0.1:8000/analyze/", {
        method: "POST",
        body: formData,
      });

      const data = await response.json();

      setMatchScore(data.match_score);
      setSemanticScore(data.semantic_score);
      setSkillMatch(data.skill_match_percentage);
      setMissingSkills(data.missing_skills || []);
      setSkillSummary(data.skill_summary);

      fetchHistory();

      setTimeout(() => {
        resultRef.current?.scrollIntoView({ behavior: "smooth" });
      }, 300);
    } catch (error) {
      alert("Backend not running!");
    }
  };

  const fetchHistory = async () => {
    try {
      const response = await fetch("http://127.0.0.1:8000/history/");
      const data = await response.json();
      setHistory(data);
    } catch (error) {
      console.log("History error");
    }
  };

  useEffect(() => {
    fetchHistory();
  }, []);

  return (
    <div className="container">
      <div className="card">
        <h1>ðŸš€ AI Resume Analyzer</h1>

        <label className="upload-btn">
          Upload Resume
          <input
            type="file"
            hidden
            onChange={(e) => setResume(e.target.files[0])}
          />
        </label>

        {resume && <p>{resume.name}</p>}

        <textarea
          placeholder="Enter Job Description..."
          value={jobDescription}
          onChange={(e) => setJobDescription(e.target.value)}
        />

        <button onClick={analyzeResume} className="analyze-btn">
          Analyze Resume
        </button>

        {matchScore !== null && (
          <div className="results" ref={resultRef}>
            <div className="score-box">
              <h2>{matchScore.toFixed(0)}%</h2>
              <p>Final Match Score</p>
            </div>

            <div className="breakdown">
              <h3>ðŸ“Š Score Breakdown</h3>
              <p>ðŸ§  Semantic Match: {semanticScore}%</p>
              <p>ðŸŽ¯ Skill Match: {skillMatch}%</p>
            </div>

            {skillSummary && (
              <div className="breakdown">
                <h3>ðŸ“‹ Skill Breakdown</h3>
                <p>Required Skills: {skillSummary.required_count}</p>
                <p>Matched: {skillSummary.matched_count}</p>
                <p>Missing: {skillSummary.missing_count}</p>
              </div>
            )}

            {missingSkills.length > 0 && (
              <div className="skills-box">
                <h3>ðŸ’¡ Skills You Should Add</h3>
                <div className="skills">
                  {missingSkills.map((skill, index) => (
                    <span key={index} className="tag">
                      {skill}
                    </span>
                  ))}
                </div>
              </div>
            )}
          </div>
        )}
      </div>

      <div className="history">
        <h2>ðŸ“Š Analysis History</h2>
        {history.map((item) => (
          <div key={item.id} className="history-item">
            <span>{item.resume_filename}</span>
            <span>{item.match_score.toFixed(2)}%</span>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
